import React from 'react';
import { Container } from 'semantic-ui-react'

const Header = props => {
    const logo = require('./img/logo-profite.svg');
    return (
        <header>
            <Container>
                <img src={logo}/>
            </Container>
        </header>
    )
}

export default Header;
